    int get_index_from_rad(float rad)
    {
        int rad_int = (int)(rad * 100.0);
        if (rad_int > 628)
        {
            rad_int %= 628;
        }
        else if (rad_int < 0)
        {
            if (rad_int < -628)
            {
                rad_int = -(rad_int % 628);
            }
            rad_int = 628 + rad_int;
        }
        return rad_int;
    }

    float get_cos(float rad)
    {
        int rad_int = Math::get_index_from_rad(rad);
        return Math::cos_table[rad_int];
    }

    float get_sin(float rad)
    {
        int rad_int = Math::get_index_from_rad(rad);
        return Math::sin_table[rad_int];
    }
